import request from '@/utils/request'; // 查询仪表型号

export function queryKindList(query) {
  return request({
    url: "/ems/meterKind/kindList",
    method: 'get',
    params: query
  });
} // 查询

export function queryMeterType(query) {
  return request({
    url: "/ems/meterType/typeList",
    method: 'get',
    params: query
  });
} // 新增

export function createMeterType(data) {
  return request({
    url: "/ems/meterType/typeSave",
    method: 'post',
    data: data
  });
} // 更新

export function updateMeterType(code, data) {
  return request({
    url: "/ems/meterType/typeUpdate/".concat(code),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteMeterType(data) {
  return request({
    url: "/ems/meterType/typeDelete",
    method: 'delete',
    data: data
  });
}
